  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Alaska
  Maritime NWR (including the Aleutian Island Unit) outlines Refuge accomplishments
  during the 1981 calendar year. The report begins with a summary of the year's weather
  conditions. Land acquisition is covered. The report includes a planning section
  which discusses the master plan and research and investigations. Refuge administration
  is outlined; information about personnel, youth programs, manpower programs, volunteer
  programs, funding, and safety is given. Habitat management is also covered; subjects
  include wetlands, forests, grazing, and wilderness areas. The wildlife section of
  the report discusses endangered and threatened species, waterfowl, shorebirds, raptors,
  game mammals, marine mammals, fisheries resources, scientific collections, animal
  control, and marking and bird banding. The public uses of the Refuge described in
  this report include outdoor classrooms, interpretive programs, hunting, fishing,
  trapping, wildlife observation, outdoor recreation, and law enforcement. The equipment
  and facilities section of the report provides information about new construction,
  rehabilitation, major maintenance, equipment replacement, communication systems,
  and energy conservation. Items of interest are provided at the end. Refuge brochures
  are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
